import React from 'react';
import './App.css';

function App() {
  return (
    <div className="container">
      {/* Header */}
      <header className="header">
        <div className="logo">
          <h1>Mashs Consultoria</h1>
        </div>
        <nav>
          <a href="#sobre">Sobre</a>
          <a href="#servicos">Serviços</a>
          <a href="#planos">Planos</a>
          <a href="#contato">Contato</a>
        </nav>
      </header>

      {/* Seção Sobre */}
      <section id="sobre" className="section about">
        <h2>Quem Somos</h2>
        <p>
          Somos uma consultoria especializada em tecnologias inovadoras. Nossa missão é ajudar empresas a alcançar o seu potencial máximo utilizando as soluções mais avançadas em tecnologia, IA e automação.
        </p>
      </section>

      {/* Seção Serviços */}
      <section id="servicos" className="section servicos">
        <h2>Serviços</h2>
        <div className="servicos-container">
          {servicos.map((s, i) => (
            <div key={i} className="card">
              <h3>{s.titulo}</h3>
              <p>{s.descricao}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Seção Planos */}
      <section id="planos" className="section planos">
        <h2>Planos e Valores</h2>
        <div className="planos-container">
          {planos.map((p, i) => (
            <div key={i} className="card">
              <h3>{p.nome}</h3>
              <p><strong>Valor:</strong> {p.valor}</p>
              <ul>
                {p.itens.map((item, idx) => <li key={idx}>{item}</li>)}
              </ul>
            </div>
          ))}
        </div>
      </section>

      {/* Seção Contato */}
      <section id="contato" className="section contato">
        <h2>Contato</h2>
        <p>Entre em contato para discutir como podemos ajudar a sua empresa.</p>
        <button className="button">Fale Conosco</button>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2025 Mashs Consultoria. Todos os direitos reservados.</p>
      </footer>
    </div>
  );
}

const servicos = [
  { titulo: 'Consultoria em TI', descricao: 'Transformação digital para otimização de processos.' },
  { titulo: 'Automação de Sistemas', descricao: 'Automatização de processos e integração entre sistemas.' },
  { titulo: 'Infraestrutura de Nuvem', descricao: 'Soluções escaláveis de infraestrutura com alta disponibilidade.' },
  { titulo: 'Inteligência Artificial', descricao: 'Desenvolvimento de IA para análise de dados e tomada de decisões.' },
  { titulo: 'Segurança da Informação', descricao: 'Proteção de dados e redes com as melhores práticas de segurança.' },
];

const planos = [
  {
    nome: 'Plano Básico',
    valor: 'R$ 1.500/mês',
    itens: ['Suporte 24/7', 'Consultoria em TI', 'Análise mensal de performance']
  },
  {
    nome: 'Plano Avançado',
    valor: 'R$ 3.000/mês',
    itens: ['Consultoria estratégica', 'Automação de processos', 'Análise preditiva de dados', 'Relatórios customizados']
  },
  {
    nome: 'Projeto Sob Demanda',
    valor: 'Sob consulta',
    itens: ['Projetos personalizados', 'Consultoria especializada', 'Desenvolvimento customizado']
  }
];

export default App;
